import React, { useCallback } from "react";
import { formateDate, formateNum, formateNumToFixed } from './functions.js';

const withFormateData = (Component) => {
  return (props) => {
    const formateData = useCallback((data) => {
      const newData = data;
      // newData.temp = formateNum(data.temp) 
      // debugger
      // newData.datetime = formateDate(data.datetime)
      // newData.pres = formateNum(data.pres / 1.333) 
      // newData.wind_spd = formateNumToFixed(data.wind_spd)

      newData.map(el => {

        el.temp = formateNum(data.temp);
        el.datetime = formateDate(data.datetime)
        el.pres = formateNum(data.pres / 1.333)
        el.wind_spd = formateNumToFixed(data.wind_spd)
        return newData
      })

      return newData;
    }, []);

    return <Component {...props} formateData={formateData} />
  }
}

export default withFormateData;
